import React, { useState, useEffect } from 'react';
import {
    AppBar,
    Toolbar,
    Typography,
    Button,
    Container,
    Box,
    TextField,
    Paper,
    MenuItem,
    Select,
    FormControl,
    InputLabel,
} from '@mui/material';
import axios from '../utils/axiosConfig';
import { useNavigate } from 'react-router-dom';
import { toast } from 'react-toastify';

const Home = () => {
    const [file, setFile] = useState(null);
    const [fileType, setFileType] = useState('csv'); // Default file type
    const [datasetExists, setDatasetExists] = useState(false); // Check if a dataset already exists
    const [replacing, setReplacing] = useState(false); // Track if user clicked "Replace Dataset"
    const navigate = useNavigate();

    useEffect(() => {
        // Check if the user already has an uploaded dataset
        const checkDatasetStatus = async () => {
            try {
                const response = await axios.get('/dataset-status', {
                    headers: { Authorization: `Bearer ${localStorage.getItem('token')}` },
                });
                setDatasetExists(response.data.datasetExists || false);
            } catch (error) {
                console.error('Error checking dataset status:', error);
                toast.error('Failed to check dataset status.');
            }
        };
        checkDatasetStatus();
    }, []);

    const handleLogout = () => {
        toast.info('You have been logged out!');
        navigate('/login');
    };

    const handleReplaceDataset = async () => {
        if (!file) {
            toast.warning('Please select a dataset to upload.');
            return;
        }

        if (!fileType) {
            toast.warning('Please select the file type.');
            return;
        }

        const formData = new FormData();
        formData.append('file', file);
        formData.append('file_type', fileType);

        try {
            const response = await axios.post('/replace-dataset', formData, {
                headers: {
                    'Content-Type': 'multipart/form-data',
                    Authorization: `Bearer ${localStorage.getItem('token')}`,
                },
            });
            toast.success(response.data.message || 'Dataset replaced successfully!');
            navigate('/chat'); // Redirect to chat page with new dataset
        } catch (error) {
            console.error('Error replacing dataset:', error);
            toast.error(error.response?.data?.message || 'Failed to replace dataset.');
        }
    };

    const handleContinueToChat = () => {
        navigate('/chat'); // Redirect to chat page with the existing dataset
    };

    return (
        <>
            {/* Navigation Bar */}
            <AppBar position="sticky" sx={{ mb: 4, bgcolor: '#d32f2f', boxShadow: 2 }}>
                <Toolbar>
                    <Typography variant="h6" sx={{ flexGrow: 1, color: '#fff' }}>
                        MyApp
                    </Typography>
                    <Button color="inherit" onClick={() => navigate('/home')} sx={{ textTransform: 'none' }}>
                        Home
                    </Button>
                    <Button color="inherit" onClick={handleLogout} sx={{ textTransform: 'none' }}>
                        Logout
                    </Button>
                </Toolbar>
            </AppBar>

            {/* Main Content */}
            <Container
                sx={{
                    height: 'calc(100vh - 64px)', // Subtract navbar height
                    display: 'flex',
                    justifyContent: 'center',
                    alignItems: 'center',
                    backgroundColor: '#ffebc5', // Light yellow background
                }}
            >
                <Paper
                    elevation={6}
                    sx={{
                        padding: 4,
                        borderRadius: 2,
                        width: '100%',
                        maxWidth: 500,
                        textAlign: 'center',
                        backgroundColor: '#fff3e0', // Light orange for the paper
                        boxShadow: 3,
                    }}
                >
                    <Typography variant="h5" gutterBottom sx={{ color: '#d32f2f', fontWeight: '600' }}>
                        {datasetExists && !replacing
                            ? 'Dataset Already Uploaded'
                            : 'Upload Your Dataset'}
                    </Typography>

                    {/* Show options if dataset exists */}
                    {datasetExists && !replacing && (
                        <Box>
                            <Button
                                variant="contained"
                                color="primary"
                                fullWidth
                                sx={{
                                    mb: 2,
                                    textTransform: 'none',
                                    fontWeight: 'bold',
                                    bgcolor: '#388e3c',
                                    '&:hover': { bgcolor: '#2e7d32' },
                                }}
                                onClick={handleContinueToChat}
                            >
                                Continue to Chat
                            </Button>
                            <Button
                                variant="contained"
                                color="secondary"
                                fullWidth
                                sx={{
                                    textTransform: 'none',
                                    fontWeight: 'bold',
                                    bgcolor: '#d32f2f',
                                    '&:hover': { bgcolor: '#b71c1c' },
                                }}
                                onClick={() => setReplacing(true)} // Show file upload form
                            >
                                Replace Dataset
                            </Button>
                        </Box>
                    )}

                    {/* Show file upload form if replacing or no dataset exists */}
                    {(replacing || !datasetExists) && (
                        <Box>
                            <Box sx={{ mt: 3, mb: 2 }}>
                                <TextField
                                    type="file"
                                    fullWidth
                                    inputProps={{
                                        onChange: (e) => setFile(e.target.files[0]),
                                    }}
                                    sx={{
                                        backgroundColor: '#fff',
                                        borderRadius: 1,
                                        '& input': {
                                            color: '#000', // Adjust text color for file input
                                        },
                                    }}
                                />
                            </Box>
                            <FormControl fullWidth sx={{ mb: 2, backgroundColor: '#fff', borderRadius: 1 }}>
                                <InputLabel id="file-type-label" sx={{ color: '#d32f2f' }}>
                                    File Type
                                </InputLabel>
                                <Select
                                    labelId="file-type-label"
                                    value={fileType}
                                    onChange={(e) => setFileType(e.target.value)}
                                    fullWidth
                                    sx={{
                                        color: '#000',
                                        '& .MuiOutlinedInput-notchedOutline': {
                                            borderColor: '#d32f2f',
                                        },
                                        '&:hover .MuiOutlinedInput-notchedOutline': {
                                            borderColor: '#c2185b',
                                        },
                                    }}
                                >
                                    <MenuItem value="csv">CSV</MenuItem>
                                    <MenuItem value="tsv">TSV</MenuItem>
                                </Select>
                            </FormControl>
                            <Button
                                variant="contained"
                                color="error"
                                fullWidth
                                size="large"
                                onClick={handleReplaceDataset}
                                sx={{
                                    textTransform: 'none',
                                    fontWeight: 'bold',
                                    borderRadius: 2,
                                    boxShadow: 3,
                                    '&:hover': {
                                        backgroundColor: '#b71c1c', // Darker red for hover
                                        boxShadow: 5,
                                    },
                                }}
                            >
                                Upload
                            </Button>
                        </Box>
                    )}
                </Paper>
            </Container>
        </>
    );
};

export default Home;
